import ReactDOM from 'react-dom';

const name="Shankha"
const date= new Date();
const cDate= date.getDate() +"."+ (date.getMonth()+1) +"."+ date.getFullYear();
const cTime= date.toLocaleTimeString();
const headingStyle ={
   color:"blue",
   fontSize:"2em",
   textAlign:"center"
}

ReactDOM.render(
 <>
    <h1 style={headingStyle}>{`My name is ${name} `}</h1>
    <p>{`Current date is ${cDate}`}</p>
    <p>{cTime}</p>

 </>
  , document.getElementById("root")
);
